import Head from "next/head";
import React, { useState, useEffect } from "react";

function Page() {
  const [tal, setTal] = useState();

  useEffect(() => {
    fetch("https://jsonplaceholder.typicode.com/posts")
      .then((response) => response.json())
      .then((json) => setTal(json));
  }, []);

  function deleteGet() {
    fetch("https://jsonplaceholder.typicode.com/posts/", {
      method: "DELETE",
    })
      .then((response) => response.json())
      .then((json) => setTal(json));
  }
  function Filtro1() {
    fetch("https://jsonplaceholder.typicode.com/posts?userId=1")
      .then((response) => response.json())
      .then((json) => setTal(json));
  }
  console.log(tal);
  return (
    <>
      <Head>
        <title>Seja bem vindo</title>
      </Head>
      <div>
        <>
          <button
            onClick={() => {
              Filtro1();
            }}
          >
            Filtro 1
          </button>
          <button
            onClick={() => {
              deleteGet();
            }}
          >
            Delete
          </button>
          <br></br>
          {tal?.length >= 1 && (
            <div className="teste">
              {tal.map((post) => {
                return (
                  <>
                    <span>{post.id}</span>
                    <a href={`/teste/${post.id}`}>Visualizar</a>
                    <br />
                  </>
                );
              })}
            </div>
          )}
        </>
      </div>
    </>
  );
}
Page.getInitialProps = async () => {
  return {};
};
export default Page;
